import React from 'react';

const Write = () => {
    return (
        <div className="add">
            <div className="content">
                <input type="text" placeholder='Title' />
            </div>
            <div className="menu">
                <div className="item">i1</div>
                <div className="item">i2</div>
            </div>
        </div>
    );
}

export default Write;
